#include <freepoi/net/codec.h>
#include "test.h"

const char s1[] = { 0x00, 0x04, 'Y', 'E', 'A', 'H' };

const char s2[] = "\x00\x02"
                  "";

uint8_t buf[sizeof(s2)] = { };
static const struct freepoi_short_string null_string = {"", 0, 0};
static const struct freepoi_short_string yeah_string = {"YEAH", 0, 4};
static const struct freepoi_short_string long_string = {&s2[2], 0, 0x10002};


int
main(void)
{
    void *p;

    print_test_message("Checking if zero-length sources are rejected");
    p = freepoi_encode_string(buf, 42, &null_string);
    is_equal(p, buf + 2);

    print_test_message("Checking if the returned offset is correct");
    p = freepoi_encode_string(buf, 42, &yeah_string);
    is_equal(p, buf + 4 + 2);

    print_test_message("Checking if the encoded string is correct");
    memcmp_test(buf, s1, sizeof(s1));

    print_test_message("Checking if sources larger than destination size are rejected");
    p = freepoi_encode_string(buf, 4, &yeah_string);
    is_equal(p, NULL);

    print_test_message("Checking if long strings are truncated correct");
    p = freepoi_encode_string(buf, sizeof(buf), &long_string);
    test_verbose(!memcmp(buf, s2, 2), "Expected 0x%02x%02x, got 0x%02x%02x\n",
                 s2[0], s2[1], buf[0], buf[1]);

    print_test_message("Checking if the offset returned for long strings are correct");
    is_equal(p, buf + 2 + 2);

    print_test_message("Checking if the encoded long string is correct");
    memcmp_test(buf, s2, 4);

    return ALL_CLEAR;
}
